            <p>3528 Gentian Blvd</p>
            <p>Columbus, Georgia. </p>
            <p>(678) 668-3880 </p>
            <h5>realdipe@gmail.com. </h5>
            {/* <a href="https://www.linkedin.com/in/racheal-ogundipe/"></a> */}
        </div>
    );
}

export default Contant;
